import React, { useContext, useEffect } from "react";
import axios from "axios";
import { useState } from "react/cjs/react.development";

function AppDetails(){
    const[details , setDetails] = useState({name:'' , company:'' , logo:'' , genre:'' ,rating:'' , resources:[] , description:''})
    useEffect(()=>{
        axios.get(`http://localhost:8080${window.location.pathname + window.location.search}`)
        .then((response)=>{
            setDetails(response.data)
        })
    })
    return(
        <div className="app-details">
            <div className="header">
                <div className="logo">
                    <img src={details['logo']}/>
                </div>
            </div>
        </div>
    )
}

export default AppDetails
